window.bookSummaryJSON = "<p>I don’t know who I am or what happened to me.<br> <br> I know that I’ve been running, but from what, I don’t know. And I know that the five men surrounding my hospital bed are important, possibly even precious to me, but they all swear they haven’t met me before.<br> <br> They say they feel it too—this familiarity, this connection.<br> <br> So when danger comes looking, these five strangers take it upon themselves to hide me away while we put together the pieces of my past. What we find instead is darker—a twisted conspiracy that ties all six of us together in an unexpected and terrifying web of danger.<br> <br> <i>Progeny</i> is a multi-POV contemporary MMFMMM romance. Please refer to the author's biography for a list of sensitive content.</p>"; 
